import { Link } from 'react-router-dom'

function Results() {
    return (
        <div className="row p-5 align-items-center text-center bg-grey">
            <div className="h2">Les compétences dont vous avez besoin :
                <div className="label">UX Design, frontend, backend</div>
                <Link to="/" className="row mt-5 px-5 btn rounded-pill bg-purple">Découvrez nos profils</Link>
            </div>
        </div>
    )
}

export default Results;
